    top: -5vh;
    right: -1px;
    user-select: none;
}


.card-container {
    height: 100%;
    position: relative;
    width: 100%;
}
.card-container .button-container .button{
    display: flex;
    align-items: center;
}
.item .card-side{
    background: radial-gradient(circle at center, transparent -400%, #232323 70%) no-repeat fixed;
    background-size: 125% 150%;
    border: #4F4F4F solid 1px;
    font-family: "Proxima Nova", sans-serif;
    color: #FFFFFF;
}
.card-container .item .front{
    display: flex;
    flex-direction: column;
    justify-content: space-between;
}

.carousel .item.active{
    height: 450px;
    width: 400px;
}
.carousel .item.next{
    height: 350px;
    width: 300px;
}
.carousel .item.prev{
    height: 350px;
    width: 300px;
}

.card-content {
    position: relative;
    z-index: 2;
    top: 50%;
    left: 50%;
}
.person-card-image{
    position: absolute;
    z-index: -1;
    left: 30%;
    bottom: 0;
    height: 50%;
}

.main-description {
    width: 30%;
    color: #FFFFFF;
    font-family: 'Proxima Nova', sans-serif;
    margin-left: 3%;
}
.top-description{
    position: absolute;
    top: 0;
}
.bottom-description{
    bottom: 5vh;
    position: absolute;
    width: 40%;
    height: 20%;
}
.bottom-description h4{
    font-size: 100%;
}

.card-button{
    font-family: "Proxima Nova", sans-serif;
    font-weight: 400;
    color: #FFFFFF;
    text-decoration: none;
    height: 40px;
    min-width: 10vw;
    background-color: #353535;
    border: none;
    border-radius: 100px;
    margin-top: 5%;
    font-size: 1vw;
}
.card-button img{
    width: 12%;
    margin-right: 5%;
    margin-left: 5%;
    transform: rotate(-45deg);
}

/* Schedule */
.schedule-container {
    display: flex;
    flex-direction: column;
    align-items: center;
}
.schedule-container > p{
    width: 60%;
    text-align: center;
    font-weight: 400;
    margin: 0;
}

.schedule-title{
    font-weight: 700;
    margin: 5% 0;
}

.schedule-item{
    display: flex;
    background-color: #232323;
    min-height: 140px;
}
.schedule-item-time{
    display: flex;
    width: 35%;
    justify-content: center;
    align-items: center;
}
.schedule-item h5{
    margin: 0;
    font-weight: 800;
}
.schedule-item-description h5{
    margin-bottom: 10px;
    font-weight: 800;
}
.schedule-item-description{
    padding-right: 10%;
    display: flex;
    width: 65%;
    flex-direction: column;
    justify-content: center;
}
.schedule-item-description p{
    margin: 0;
}
.schedule-item{
    margin-bottom: 30px;
    box-shadow: 0 2px 8px #00000014;
}

.schedule-container .main-button{
    font-family: "Proxima Nova", sans-serif;
    font-weight: 800;
    background-color: #FFC200;
}

.schedule-side-bar{
    height: 100vh;
    background-color: #f8ca14;
    position: relative;
    z-index: 5;
}

/* Ribbon */
.ribbon-container{
    margin-top: 10%;
}
.ribbon {
    font-family: Manrope, sans-serif;
    font-weight: 400;

    width: 100vw;
    height: 5vw;

    position: relative;
}
.first-ribbon{
    background: #F8CA14;
    transform: rotate(5deg);
    color: black;
}
.second-ribbon{
    background: black;
    transform: rotate(-5deg);
    color: white;
    top: -50%;
}
.second-ribbon .separator{
    color: #F8CA14;
}
.ribbon-labels {
    display: flex;
    align-items: center;
    justify-content: center;
    position: absolute;
    top: 50%;
    left: 0;
    right: 0;
    transform: translateY(-50%);
}
.ribbon-labels h2{
    font-size: 2vw;
    padding: 0 3vw;
    margin: 0;
}
.separator {
    color: black;
    font-size: 3vw;
}

/* Participants */
.participants{
    display: flex;
    flex-direction: column;
    align-items: center;
}
.participants-container{
    display: flex;
    flex-wrap: wrap;
    justify-content: space-evenly;
    width: 100%;
    margin-top: 10%;
}
.participants-item {;
    width: 30%;
    height: 22vw;
    background-color: #232323;
    position: relative;
    margin-bottom: 10%;
    display: flex;
    justify-content: center;
    border-radius: 3px;
}
.participants-item img {
    object-fit: cover;
    width: 15vw;
    height: 15vw;
    border-radius: 50%;
    position: absolute;
    top: -7vw;
}
.participants-item h2{
    position: absolute;
    top: 11vw;
    width: 80%;
    height: 50%;
    font-family: "Proxima Nova", sans-serif;
    font-weight: 800;
    font-size: 2vw;
    text-align: center;
}

/* Partners */
.partners{
    display: flex;
    flex-direction: column;
    align-items: center;
}
.partners h2{
    font-size: 40px;
    font-weight: 700;
}
.partners p{
    width: 60%;
    text-align: center;
}
.partners-container{
    display: flex;
    flex-wrap: wrap;
    justify-content: space-evenly;
    width: 80%;
}
.partners-item{
    position: relative;
    margin: 0 3% 0 3%;
    display: flex;
    justify-content: center;
    height: 10vw;
    width: 11vw;
}
.partners-item img{
    object-fit: contain;
    width: 100%;
    height: 100%;
}
.partners .main-button{
    width: 15vw;
    height: 5vw;
    padding: 1vw;
    font-size: 1.5vw;
    display: flex;
    align-items: center;
    justify-content: center;
    user-select: none;
}

/* Auditorium */
.auditorium{
    display: flex;
    width: 90%;
    margin: 120px auto auto;
}
.auditorium *{
    display: flex;
    flex-direction: column;
    justify-content: center;
}
.auditorium-description{
    width: 60%;
    margin-right: 5%;
}
.auditorium-description h2{
    font-size: 26px;
    font-weight: 700;
}
.auditorium-description .main-button{
    font-size: 16px;
    width: fit-content;
    font-weight: 700;
    background-color: #F8CA14;
}

/* Timer */
.timer{
    display: flex;
    flex-direction: column;
    align-content: center;
    margin-top: 10%;
}
.gradient-line {
    width: 72%;
    height: 7px;
    margin: 30px auto 0;

    background: linear-gradient(to right, rgba(255, 255, 255, 0), white, rgba(255, 255, 255, 0));
}

/* further code for Timer is in css/timer.css */

/* Plans */
.plans{
    margin-top: 100px;
    display: flex;
    flex-direction: column;
    align-items: center;
}
.plans p{
    color: #E3E3E3;
    width: 60%;
    text-align: center;
}
.plans h1{
    font-weight: 700;
    font-size: 48px;
    line-height: 60px;
}

.plans-container{
    display: flex;
    justify-content: space-evenly;
    width: 100%;
    margin-top: 5%;
}

.plan{
    padding: 40px 0;
    display: flex;
    flex-direction: column;
    align-items: center;
    border-radius: 8px;
    color: black;
    width: 27%;
}
.plan img{
    user-select: none;
}
.plan p{
    color: black;
}
.plan h2{
    font-weight: 700;
    margin-top: 20px;
}
.plan h1{
    font-weight: 700;
    margin-top: 40px;
}

.plan:first-child{
    margin-left: 5%;
}
.plan:last-child{
    margin-right: 5%;
}

.plan:nth-child(1){
    background-color: #F0F0F0;
}
.plan:nth-child(1) p{
    color: #828282;
}

.plan:nth-child(2){
    background-color: #F8CA14;
}
.plan:nth-child(2) button{
    background-color: black;
    color: white;
}

.plan:nth-child(3){
    color: #F8CA14;
    background-color: black;
}
.plan:nth-child(3) p{
    color: #F8CA14;
}

.plan:nth-child(3) button{
    background-color: #F8CA14;
    color: white;
}

.excluded{
    color: #BDBDBD;
}

.plan ul {
    width: 80%;
    padding: 0;
    list-style-type: none; /* Remove default marker */
}
.plan ul li{

    margin-bottom: 15px;
    font-size: 16px;
    display: flex;
    align-items: center;
}
.plan ul li img{
    margin-right: 10px;
}

.plan button{
    width: 80%;
    height: 4vw;
    border: 1px solid black;
    border-radius: 8px;

    font-weight: 600;
    font-size: 16px;
}

/* Request */
.request{
    display: flex;
    flex-direction: column;
    align-items: center;
    margin-top: 100px;
}
.request h1{
    font-weight: 700;
    font-size: 48px;
    line-height: 60px;
}
.request p{
    width: 60%;
    text-align: center;
}
.request-container{
    display: flex;
    justify-content: space-evenly;
    width: 100%;
    margin-top: 5%;
}
.request-container textarea, input, button {
    border: none;
    outline: none;
}
.request-container input{
    width: 100%;
    height: 50px;
    padding: 0 10px;
}

.choose-tariff{
    border-radius: 8px;
    width: 30%;
    padding: 40px 0;
}
.choose-tariff button{
    width: 15%;
    background-color: #E0E0E0;
    border-top-right-radius: 8px;
    border-bottom-right-radius: 8px;
}
.choose-tariff form{
    display: flex;
    box-sizing: border-box;
}
.choose-tariff p {
    color: #828282;
    width: 100%;
    text-align: start;
}
.choose-tariff ul{
    padding: 0;
}
.choose-tariff ul li{
    font-family: Spartan, sans-serif;
    font-size: 20px;
    font-style: normal;
    font-weight: 700;
    line-height: 30px;
    display: flex;
    align-items: center;
    height: 60px;
    width: 100%;
    list-style-type: none;
    border-bottom-right-radius: 8px;
    border-top-right-radius: 8px;
    border-top-left-radius: 8px;
    color: #828282;
}
.choose-tariff ul li{
    cursor: pointer;
}
.choose-tariff ul li svg{
    margin-left: 1vw;
}
.choose-tariff ul li div{
    width: 100%;
    display: flex;
    justify-content: space-between;
    align-items: center;
}
.choose-tariff ul li div p{
    width: fit-content;
    margin: 0 0.7vw;
}

.promo-input{
    border-top-left-radius: 8px;
    border-bottom-left-radius: 8px;
    font-family: Spartan, sans-serif;
    font-size: 16px;
    font-weight: 400;
    line-height: 24px;
    letter-spacing: 0;
    text-align: left;
}

.selected-tariff {
    background-color: #F8CA14 !important;
}
.selected-tariff div p{
    color: black !important;
}
.selected-tariff svg path{
    fill: white !important;
}

.credentials-form{
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    border-radius: 4px;
    border-width: 1px;
    border-style: dashed;
    border-color: #E0E0E0;
    width: 50%;
    padding: 80px 50px;
}
.credentials-form h4{
    margin: 0 0 20px 0;
}
.credentials-form input{
    border-radius: 8px;
    margin-bottom: 25px;
}
.credentials-form form div{
    display: flex;
    justify-content: space-between;
    font-size: 20px;
    align-items: center;
}
.credentials-form button{
    height: 4vw;
    width: 30%;
    font-size: 1.5vw;
    padding: 0;
}
.credentials-form p{
    width: fit-content;
    margin: 0;
    font-size: 2vw;
    padding: 0;
    text-align: center;
    color: #FFC200;
    font-weight: 700;
}

/* Footer */
.footer{
    display: flex;
    flex-direction: column;
    align-items: center;
    margin-top: 100px;
    background-color: rgb(248, 202, 20);
    padding: 10px 0;
    color: black;
}
.footer p{
    width: 60%;
    text-align: center;
    color: #4F4F4F;
}
.footer button{
    width: 15%;
    height: 4vw;
    background-color: black;
    border: none;
    color: white;
    border-radius: 8px;
    font-size: 1.5vw;
    font-weight: 400;
    margin-top: 20px;
    padding: 0;
}
.footer div{
    display: flex;
    justify-content: space-between;
    width: 50%;
    margin-top: 20px;
}
@media (max-width: 1100px) {
    /* common */
    .blur{
        display: none;
    }
    .body-container{
        width: 100%;
    }

    /* Main description */
    .rectangle{
        display: none;
    }
    .main-description-container {
        flex-direction: column;
        align-items: center;
        height: 300px;
    }
    .main-description {
        text-align: center;
        width: 45%;
        padding: 50px 0;
        margin: 0 auto;
    }

    .carousel .item.active{
        height: 50vw;
        width: 40vw;
    }
    .carousel .item.prev {
        height: 35vw;
        width: 25vw;
    }
    .carousel .item.next {
        height: 35vw;
        width: 25vw;
    }
    .carousel .button-container {
        width: 50vw;
    }

    .top-description p{
        font-size: 100%;
    }
    .top-description h1{
        font-size: 150%;
    }

    /* Auditorium */
    .auditorium .auditorium-description{
        width: 100%;
        margin-right: 0;
        background-image: url(../images/auditorium.png);
        background-size: cover;
        background-repeat: no-repeat;
        height: 476px;
    }
    .auditorium .auditorium-image{
        display: none;
    }

    /* Request */
    .request-container{
        flex-direction: column;
        align-items: center;
    }
    .request-container div{
        width: 70%;

    }
}
